p = "CCCATGCATCCT"
dna=""
d = 5
n = len(dna)
m = len(p)

dic = {}
cnt = 0
for i in range(n-m+1):
  sub = dna[i:i+m]
  cnt += 1
  if sub not in dic.keys():
    dic[sub] = [i]
  else:
    dic[sub].append(i)

def mismatch(dna, p, n, d):
  cnt = 0
  for i in range(n):
    if not(dna[i] == p[i]):
      cnt += 1
  return (cnt <= d)

ans = []
for key in dic.keys():
  if mismatch(key, p, m, d):
    ans = ans + dic[key]

for id in ans:
  print(id, end=" ")
